import { ReactiveFormsModule } from '@angular/forms';
import { CommonModule } from '@angular/common';
import { LoginComponent } from './pages/login/login.component';

@NgModule({
  declarations: [
    LoginComponent,
    // ... outros componentes ...
  ],
  imports: [
    CommonModule,
    ReactiveFormsModule,
    // ... outros módulos ...
  ],
  // ...
})
export class AppModule { }
